***** ĐANG CÒN PHÒNG GIẢM 20% THÁNG ĐẦU TIÊN *****

Nhà phố biệt lập, lầu 1 cư xá có lối đi riêng, gởi xe thuận tiện.
Đến Chợ Hòa Bình 5 phút, Chợ An Đông 5 phút, BV Nguyễn Trãi 5 phút đi bộ;
Gần các Trường học, đến Cơ sở 1 Trường Đại học Văn Lang 10 phút đi xe, thuận tiện 10 phút đến Xa lộ Đông Tây và Bến xe Phương Trang, Xe Thành Bưởi .
Nhà có diện tích sử dụng 122 mét vuông, gồm:
- Phòng khách 16 mét vuông;
- 4 phòng ở riêng:
+ 2 phòng 12 mét vuông,
+ 1 phòng 16 mét vuông
+ 1 phòng 28 mét vuông;
- Có bếp, giếng trời, sân trước và nhà vệ sinh 38 mét vuông;
- Điện nước mạnh, hồ nước mái 5 khối;
Giá định mức gđ sinh hoạt rẻ.
- Khu vực an ninh, gần chợ, siêu thị kề bên, giá cả ăn uống sinh hoạt không cao.

212 Nguyễn Văn Đậu, P.11, Bình Thạnh
- (SẮP TRỐNG) 1P ban công, máy giặt riêng (lầu 2): ngày 10/10 trống,
- Giá: 8tr3
Chi phí:
- Điện: 4k, Nước: 100k/người, Dịch vụ (rác, quản lý, vệ sinh hành lang, bảo trì): 150k/phòng, xe: 100k/ chiếc;
Tiện ích:
- Thang máy, ra vào vân tay, có hầm để xe;
- Thanh toán tiền nhà ngày 10 hằng tháng;
- Cho nuôi mèo, không cho nuôi chó.

Chính chủ cần cho thuê nhà nguyên căn 1 tầng, diện tích 54m2 ở mặt ngõ 318 phố Bùi Xương Trạch;
Công trình phụ khép kín; có điều hòa, bình nóng lạnh, giường, tủ;
Điện nước theo giá Nhà Nước;
Vị trí đẹp, an ninh tốt, phía trước là hồ điều hòa, ngõ rộng ô tô đỗ trước cửa, gần trường học, chợ.
